import "./Navbar.css";
import profilepic from "./profile.jpg";

export default function Navbar () {
  return (
    <div className="navbar">
        <div className="profile">
            <img src={profilepic}/>
            <p>Username (Admin)</p>
        </div>    

        <ul>
            <li>Create bookings</li>
            <li>View bookings</li>
        </ul>
    </div>
  );
};
